import React from 'react';
import mealsImage from '../../assets/meals.jpg';
const Header=props=>{
    return <React.Fragment>
        <header>
            <h1>ReactMeals</h1>
            <button>Cart</button>
        </header>
        <div>
            <img src={mealsImage}/>
        </div>

    </React.Fragment>

}
export default Header;
